import React from 'react';

function Evento(){
    function cadastrarUsuario(event){
        console.log('foise')
        event.preventDefault(event)
    }
    return(
        <section>
            <form onSubmit={cadastrarUsuario}>
                <input type="text" name="s" id="s" placeholder='Digite seu Nome' />
                <input type="submit" />
            </form>
        </section>
    )
}

export default Evento
